import React from 'react';
import {Button} from 'rebass'
import { NavLink } from 'react-router-dom'

const HomeButton = () => {
  return (
  <Button>
    <NavLink exact activeClassName="current" to={'./'}>
      Home
    </NavLink>
  </Button>
)
}

export default HomeButton;
